import React from "react";
import map from "../images/worldmap.png"
import "./Contactus.css";
function Contactus() {
  return (
    <div class="main">
      <div >
        <img src={map} alt=""></img>
        <div><span>India , Mumbai</span></div>
      </div>
    </div>
  );
}

export default Contactus;
